#!/bin/bash

#SBATCH --time=05:00:00   # walltime
#SBATCH --ntasks=10   # number of processor cores (i.e. tasks)
#SBATCH --nodes=1   # number of nodes
#SBATCH --mem-per-cpu=6gb   # memory per CPU core
#SBATCH -J "MVM"   # job name



# Compatibility variables for PBS. Delete if not needed.
export PBS_NODEFILE=`/fslapps/fslutils/generate_pbs_nodefile`
export PBS_JOBID=$SLURM_JOB_ID
export PBS_O_WORKDIR="$SLURM_SUBMIT_DIR"
export PBS_QUEUE=batch

# Set the max number of threads to use for programs using OpenMP. Should be <= ppn. Does nothing if the program doesn't use OpenMP.
export OMP_NUM_THREADS=$SLURM_CPUS_ON_NODE



module load r/3.6


parDir=/fslhome/fslcollab165/compute/SleepBrain_BIDS
grpDir=${parDir}/Analyses/grpAnalysis

tempDir=/fslhome/fslcollab165/compute/Template/vold2_mni
svPrior=${tempDir}/priors_JLF
smallLab=(0017 0018 0053 0054 1002 1010 1023 1026 2002 2010 2023 2026)
# smallNam=(LHC LAmg RHC RAmg LAC LIC LPC LRAC RAC RIC RPC RRAC)

smallMask=New_SmallVol+tlrc

cd $grpDir

if [ ! -f ${smallMask}.HEAD ]; then
	for i in ${smallLab[@]}; do
		c3d ${svPrior}/label_${i}.nii.gz -thresh 0.3 1 1 0 -o tmp_label_${i}.nii.gz
	done
	c3d tmp_label* -accum -add -endaccum -o tmp_smallVol_mask.nii.gz
	3dresample -master ${parDir}/derivatives/sub-002/YNIN_stats_REML+tlrc -rmode NN -input tmp_smallVol_mask.nii.gz -prefix tmp_res.nii.gz
	c3d tmp_res.nii.gz Group_epi_mask.nii.gz -multiply -o tmp_mult.nii.gz
	c3d tmp_mult.nii.gz -thresh 0.1 1 1 0 -o tmp_final.nii.gz
	3dcopy tmp_final.nii.gz $smallMask
fi



3dMVM -prefix PartInt_FeedBack_Calorie_NewSmallVol \
-jobs 10 \
-mask $smallMask \
-bsVars 'BSVARS*Calorie' \
-wsVars Both \
-qVars 'Calorie' \
-num_glt 4 \
-gltLabel 1 Sleep_YN -gltCode 1 'BSVARS : 1*Sleep -1*NoSleep Both : 1*YN ' \
-gltLabel 2 Sleep_YI -gltCode 2 'BSVARS : 1*Sleep -1*NoSleep Both : 1*YI ' \
-gltLabel 3 Sleep_NN -gltCode 3 'BSVARS : 1*Sleep -1*NoSleep Both : 1*NN ' \
-gltLabel 4 Sleep_NI -gltCode 4 'BSVARS : 1*Sleep -1*NoSleep Both : 1*NI ' \
-dataTable \
Subj BSVARS Calorie Both InputFile \
